The most straight-forward and widely available way to set up a development environment for your robot is to take advantage of the gopherbot-dev container used in Quick Setup : 1. Create a new <botname>-dev directory and copy the robot's .env file to <botname>-dev/environment I think I've repeated this at least a dozen times, but be sure GOPHER_PROTOCOL is commented out (or missing altogether) in the environment file. Not only does this prevent connecting a second robot with the same name and credentials to your team chat, but if you examine the default distributed configuration yaml files, you'll see that it disables certain scheduled jobs and modifies the robot's behavior in other ways more suitable for a dev environment. 2. From this directory, run the gopherbot-dev container, this time supplying the robot's environment. Using "clu" as an example: $ docker run -p 127.0.0.1:3000:3000 --name clu-dev --rm --env-file environment quay.io/lnxjedi/gopherbot-dev:latest Note that you can also find a generic run-robot.sh script to use for this in github.com/lnxjedi/gopherbot/resources/containers/dev . 3. Now open your browser and connect to http://127.0.0.1:3000 , where you'll be presented with the Theia interface. I find a three-pane layout most convenient; the top pane where code and configuration can be edited, and two terminal windows - one for running the robot in terminal mode, and one for running gopherbot CLI commands. 4. In a terminal window, run gopherbot. The bootstrap plugin will clone your robot's configuration repository, and start the robot in terminal mode: $ gopherbot
